export const FizzBuzz = (num) =>  {	
	return console.log(
	(num % 3 === 0 && num % 5 === 0) ?
		"fizzBuzz" : (num % 5 === 0 ?
				"buzz" : (num % 3 === 0 ?
					"fizz" : num)
					)
				);
};
